import React, { Component } from "react";
import Navbar from "./commons/Components/Navbar";
import Footer from "./commons/Components/Footer";
import Homepage from "./all_components/Homepage";
import Register from "./homepage/Components/Register";
import Category from "./homepage/Components/Category";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

export default class App extends Component {
  render() {
    return (
      <Router>
        <div className="App">
          <Navbar />
          <Switch>
            <Route
              exact
              path="/"
              render={(props) => (
                <div>
                  <Homepage />
                </div>
              )}
            />
            <Route
              path="/register"
              render={(props) => (
                <div>
                  <Register />
                </div>
              )}
            />

            <Route
              path="/login"
              render={(props) => (
                <div>
                  <Category />
                </div>
              )}
            /> 

          </Switch>
          <Footer />
        </div>
      </Router>
    );
  }
}
